import React from "react";
import SplitPane from "react-split-pane";

import CodeMirror from '@uiw/react-codemirror';
import { javascript } from '@codemirror/lang-javascript';

const NewProject = () => {
  return (
    <div className="w-screen h-screen flex flex-col">
      {/* Header */}
      <div className="w-full bg-gray-200 p-4 flex items-center justify-between">
        <h1 className="text-2xl font-bold">Header</h1>
        <button className="bg-blue-500 text-white px-4 py-2 rounded">Button</button>
      </div>

      {/* Main Content */}
      <div className="w-full h-full flex flex-grow overflow-hidden">
        <SplitPane split="vertical" minSize={100} maxSize={-100} defaultSize={"50%"} pane1Style={{ backgroundColor: '#f3f4f6' }}>
          {/* Code Editor */}
          <div className="flex flex-col">
            <div className="p-2 border-b border-gray-300">
              <h2 className="text-lg font-semibold">Code Editor</h2>
            </div>
            <div className="flex-grow">
              <CodeMirror value="console.log('hello');" height="100%" extensions={[javascript({ jsx: true })]} onChange={() => { }} />
            </div>
          </div>

          {/* Preview */}
          <div className="flex flex-col">
            <div className="p-2 border-b border-gray-300 flex items-center justify-between">
              <h2 className="text-lg font-semibold">Preview</h2>
              <button className="bg-blue-500 text-white px-4 py-2 rounded">Compile</button>
            </div>
            <div className="flex-grow">
              {/* Add content for the preview here */}
            </div>
          </div>
        </SplitPane>
      </div>
    </div>
  );
}

export default NewProject;
